import React from 'react';

const BotCard = ({ bot, onRemoveBot }) => {
  return (
    <div className="BotCard">
      <h3>{bot.name}</h3>
      <p>Class: {bot.bot_class}</p>
      <p>Health: {bot.health}</p>
      <p>Damage: {bot.damage}</p>
      <p>Armor: {bot.armor}</p>
      <p>Armor: {bot.armor}</p>
      <p>Armor: {bot.catchphrase}</p>
      <p>Armor: {bot.created}</p>
      <p>Armor: {bot.armor}</p>
      <button onClick={() => onRemoveBot(bot)}>Remove</button>
    </div>
  );
};

export default BotCard;
